import React, { useState } from "react";
import { fetchOrgaoInfo } from "../api/pncpAPI";
import { InfoOrgao, InfoContrato, ap } from "../tipos/index";

const Search: React.FC = () => {
  const [cnpj, setCnpj] = useState("");
  const [dataInicial, setDataInicial] = useState("");
  const [dataFinal, setDataFinal] = useState("");
  const [orgao, setOrgao] = useState<InfoOrgao | null>(null);
  const [contratos, setContratos] = useState<InfoContrato[]>([]);
  const [error, setError] = useState<string | null>(null);

  const handleSearch = async () => {
    setError(null);
    try {
      const data = await fetchOrgaoInfo(cnpj, dataInicial, dataFinal, 1);
      console.log("Dados recebidos da API:", data); // Verifique aqui se os dados estão corretos

      if (data) {
        setOrgao(data.orgaoEntidade); // Certifique-se de que está pegando da estrutura correta
        setContratos(data.contratos);
      } else {
        setError(
          "Não foi possível encontrar informações para o CNPJ informado."
        );
      }
    } catch (err) {
      if (err instanceof Error) {
        setError(err.message);
      } else {
        setError("Erro desconhecido.");
      }
    }
  };

  return (
    <div className="flex flex-col min-h-screen bg-gray-50 p-6 justify-center">
      <h1 className="text-4xl font-bold text-[#59D27C] mb-8 text-center">
        OrgSearch
      </h1>
      <div className="flex justify-center items-center">
        <div className="bg-white rounded-lg p-8 shadow-lg w-full max-w-md flex-1">
          <div className="flex flex-col">
            <input
              type="text"
              placeholder="CNPJ"
              value={cnpj}
              onChange={(e) => setCnpj(e.target.value)}
              className="border rounded-lg p-3 mb-4 w-full focus:outline-none focus:ring-2 focus:ring-[#59D27C] transition duration-300"
            />
            <input
              type="date"
              value={dataInicial}
              onChange={(e) => setDataInicial(e.target.value)}
              className="border rounded-lg p-3 mb-4 w-full focus:outline-none focus:ring-2 focus:ring-[#59D27C] transition duration-300"
            />
            <input
              type="date"
              value={dataFinal}
              onChange={(e) => setDataFinal(e.target.value)}
              className="border rounded-lg p-3 mb-4 w-full focus:outline-none focus:ring-2 focus:ring-[#59D27C] transition duration-300"
            />
            <button
              onClick={handleSearch}
              className="bg-[#59D27C] text-white font-bold py-3 rounded-lg shadow hover:bg-[#45B366] transition duration-300"
            >
              Buscar contratos
            </button>
          </div>
        </div>
        <div className="flex-shrink-0 ml-24">
          {" "}
          <img
            src="/imagens/maosLupa.gif"
            alt="imagem busca"
            className="h-112 w-112 object-contain"
          />
        </div>
      </div>
      {error && <p className="text-red-600 mt-4 text-center">{error}</p>}
      {orgao && (
        <div className="mt-6 bg-white p-4 rounded-lg shadow-md">
          <h2 className="text-2xl font-bold mb-2">Informações do Órgão</h2>
          <p className="mb-1">
            <strong>Razão Social:</strong> {orgao.razaoSocial}
          </p>
          <p className="mb-1">
            <strong>CNPJ:</strong> {orgao.cnpj}
          </p>
          <p className="mb-1">
            <strong>UF:</strong> {orgao.ufNome}
          </p>
          <p className="mb-1">
            <strong>Município:</strong> {orgao.municipioNome}
          </p>
        </div>
      )}
      console.log("Dados do órgão:", orgao); // Verifique o que está sendo
      armazenado
      {contratos.length > 0 && (
        <div className="mt-6 bg-white p-4 rounded-lg shadow-md">
          <h2 className="text-2xl font-bold mb-2">Contratos</h2>
          <ul className="list-disc pl-5">
            {contratos.map((contrato, index) => (
              <li key={index} className="mb-4">
                <p>
                  <strong>Número:</strong> {contrato.numeroContratoEmpenho}
                </p>
                <p>
                  <strong>Data Início:</strong> {contrato.dataVigenciaInicio}
                </p>
                <p>
                  <strong>Data Fim:</strong> {contrato.dataVigenciaFim}
                </p>
                <p>
                  <strong>Fornecedor:</strong>{" "}
                  {contrato.nomeRazaoSocialFornecedor}
                </p>
                <p>
                  <strong>Objeto:</strong> {contrato.objetoContrato}
                </p>
                <p>
                  <strong>Valor:</strong> {contrato.valorInicial}
                </p>
              </li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
};

export default Search;
